import React from 'react';
import backVideo from '../../assets/backVideo.mp4';
import './Phone.css';

const Phone = () => {
    return (
        <div className="iphonex">
            <div className="v_cont" style={{Zindex: "-1"}}>
                <video auroplay loop muted style={{width: '100%', height: '100%'}}>

                <source src={backVideo} type='video/mp4'/>
                </video>
            </div>
        </div>
   )
}

export default Phone
